import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";
import "./Blog.css";


function Blog() {
  return (
		<div className="blog__page">
			<Container>
				<Row>
					<Col md={4}>
						<div className="blog__card">
							<h1>Blog page</h1>
						</div>
					</Col>
					<Col md={4}>
						<div className="blog__card">
							<h1>Blog page</h1>
						</div>
					</Col>
					<Col md={4}>
						<div className="blog__card">
							<h1>Blog page</h1>
						</div>
					</Col>
				</Row>
			</Container>
		</div>
	);
}

export default Blog;
